import React from 'react';

//import

const AccountBtns = () => {
  return <div className='flex items-center'>
    {/* Link btns */}
    <a classname='hover:text-blue transition' href='#'>Login</a>
    {/*Separator*/}
    <span className='mx-3 text-white/20 font-thin'>|</span>
    {/*Register*/}
    <button className='btn h-[40px] text-base px-3'>Register</button>
  </div>;
};

export default AccountBtns;
